INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Porro est quibusdam unde cumque.', 'In suscipit ex quia laborum aspernatur officiis. Error molestiae rerum dolor beatae quos maxime eligendi. Sit quo consequatur atque culpa suscipit. Voluptate minima aspernatur delectus delectus.', 'Quibusdam dolore laborum eaque minima ab reiciendis. Quia est et porro beatae dolorem neque ea. Quia sequi qui et deleniti sequi officia. Aut harum iusto eveniet ipsam non ratione earum.', '1994-01-28');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Quod veritatis saepe dolores sed.', 'Eos nihil eum repudiandae eaque impedit sit unde. Pariatur quibusdam quidem ut pariatur dolorum. Quod excepturi odit labore repudiandae molestias qui.', 'Maiores voluptatem mollitia nihil amet qui. Non in perferendis reiciendis minima deserunt aut qui quis. Aut autem itaque id laboriosam ipsum nostrum. A quam et ut qui rem eligendi soluta.', '2019-09-24');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Sequi accusantium quo voluptas.', 'Fugit odit quam et sed et dolore in. Quod fugiat voluptatibus sint qui. Iure rerum voluptatem reiciendis inventore facere possimus.', 'Eum quo beatae molestiae ut et autem. Ut ducimus voluptas doloribus. Dolor ipsa voluptates beatae quasi. Autem hic fugiat asperiores odit fugit ipsa dicta.', '1974-06-06');
